import React from 'react';
import styled from '@emotion/styled';

const Wrapper = styled.div`
display:flex;
justify-content: center;
align-items: flex-end;  
grid-row: 1;
height: 25vh;
font-family: 'Josefin Sans';
`
const Text = styled.span`
font-family: 'Josefin Sans';
color: #FF331F;
font-size: 10vh;
font-weight: 100;
`
const Logo = () => {

    return(
        <Wrapper><Text>aloud</Text></Wrapper>
    )
}

export default Logo;
